import styles from './home.module.css'

const TextGenerator = () => {
    return (
        <button>
            Générer le texte
        </button>
    )
}

const Home = () => {
    return (
        <div>
            <TextGenerator/>
            <div className={styles.container}>
                <div className={styles.button}>
                    HUMAN VS IA
                </div>
                <div className={styles.button}>
                    HUMAN VS HUMAN
                </div>
            </div>
        </div>
    )
}

export default Home
